		"id": 1477079736455102500,
		"id_str": "1477079736455102464",
		"full_text": "This is when the nurses try to take the baby away from me and I pull out my gun (which is made of bubble gum) and shout “I’ll kill you! I’ll kill all of you!”\n\nThat’s when they hit me with the tranquilizers\n\nI wake up on the psych floor &amp; am like “cancel culture is out of control",
